import React, { useEffect, useState } from 'react'
const App = () => {

  const [check,unCheck] = useState(false);
  const checkStatus=()=>{
    unCheck(true)
  }

  return (
    <React.Fragment>
      <input type="checkbox" value={check} onChange={checkStatus}/>
      <label>{check?"checked":"not checked"}</label>
    </React.Fragment>
  )
}

export default App
